function renderProductCards(){const d=document.getElementById("productpage7834");let e="";Object.keys(ProductDetails).forEach((d=>{const n=ProductDetails[d];e+=`\n      <div class="col-md-4">\n        <a href="products/qorder_detail.html?ProductId=${d}">\n          <img class="rounded img-fluid shadow w-100 fit-cover" src="${n.imgSrc}" />\n          <div>\n            <div class="py-4">\n              <h4 class="fw-bold">${n.name}</h4>\n              <p class="text-muted">${n.price} Rs</p>\n            </div>\n          </div>\n        </a>\n      </div>\n    `})),d.innerHTML=e}renderProductCards();